void main() {
  print('Hello, World!');
  final input =
      '';
  final targetLength = 14;
  var currentIndex = targetLength - 1;
  int? matchIndex;
  while (matchIndex == null && currentIndex < input.length) {
    final lastFour =
        input.substring(currentIndex - (targetLength - 1), currentIndex + 1);
    if (lastFour.split('').toSet().length == targetLength) {
      matchIndex = currentIndex;
    }
    currentIndex++;
  }

  if (matchIndex != null) {
    print('Found match at index ${matchIndex + 1}');
  } else {
    print('No match found');
  }
}
